/*Table structure for table `ada_banner` */

DROP TABLE IF EXISTS `ada_banner`;

CREATE TABLE `ada_banner` (
  `banner_id` int(11) unsigned NOT NULL auto_increment COMMENT '广告位ID',
  `banner_name` varchar(60) NOT NULL default '' COMMENT '广告位名字',
  `channel_id` int(11) unsigned NOT NULL default '0' COMMENT '频道ID, 应该和频道有个外键关系',
  `agent_id` int(11) NOT NULL default '0' COMMENT '渠道ID, 和ada_agent表有外键约束关系',
  `banner_width` smallint(5) unsigned NOT NULL default '0' COMMENT '目前没有使用',
  `banner_height` smallint(5) unsigned NOT NULL default '0' COMMENT '目前没有使用',
  `ad_inputs` varchar(50) NOT NULL default '' COMMENT '目前没有使用',
  `up_time` datetime NOT NULL default '0000-00-00 00:00:00' COMMENT '更新时间',
  `jurl_id` int(11) unsigned NOT NULL default '0' COMMENT '目前没有使用',
  `enabled` tinyint(3) unsigned NOT NULL default '1' COMMENT '标记是否可用, 删除时候把这里标记为0',
  `area` varchar(50) NOT NULL default '' COMMENT '地区',
  `content` varchar(255) NOT NULL default '' COMMENT '内容',
  `service_type` varchar(60) NOT NULL default '' COMMENT '标识游戏',
  PRIMARY KEY  (`banner_id`),
  KEY `channel_id` (`channel_id`),
  KEY `agent_id` (`agent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12290 DEFAULT CHARSET=utf8;

