/*Table structure for table `ada_channel` */

DROP TABLE IF EXISTS `ada_channel`;

CREATE TABLE `ada_channel` (
  `channel_id` smallint(5) unsigned NOT NULL auto_increment COMMENT '频道ID',
  `channel_name` varchar(60) NOT NULL default '' COMMENT '频道名称',
  `agent_id` int(11) unsigned default NULL COMMENT '所属渠道ID',
  `up_time` datetime NOT NULL default '0000-00-00 00:00:00' COMMENT '更新时间',
  `enabled` tinyint(3) unsigned NOT NULL default '1' COMMENT '标识是否可用, 删除时实际上是把这里标记为0',
  `service_type` char(32) default NULL COMMENT '标识不同游戏',
  PRIMARY KEY  (`channel_id`),
  KEY `agent_id` (`agent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=334 DEFAULT CHARSET=utf8;

