/*Table structure for table `guest_login_cvs` */

DROP TABLE IF EXISTS `guest_login_cvs`;

CREATE TABLE `guest_login_cvs` (
  `agent_id` int(8) NOT NULL COMMENT '渠道ID',
  `channel_id` int(8) NOT NULL COMMENT '频道ID',
  `banner_id` int(8) NOT NULL COMMENT '广告位ID',
  `clicks` int(8) NOT NULL COMMENT '点击数',
  `visitors` int(8) NOT NULL COMMENT '访客数',
  `clk_azid` int(8) NOT NULL COMMENT '带有zing_id的用户点击的次数',
  `clk_tzid` int(11) NOT NULL COMMENT '没有zing_id的用户点击数',
  `regs_azid` int(8) NOT NULL COMMENT '带有zing_id的用户的游戏注册数',
  `characters_azid` int(8) NOT NULL COMMENT '带有zing_id的用户的游戏创角数',
  `characters_tzid` int(8) NOT NULL COMMENT '没有zing_id的用户的创角数',
  `log_date` date NOT NULL COMMENT '记录的日期',
  `service_type` char(32) collate utf8_unicode_ci default NULL COMMENT '标识不同游戏',
  PRIMARY KEY  (`banner_id`,`log_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

